型男与痴女&nbsp;　　Leonardo，是个扮酷的男孩子，在酒吧里，他碰到了梦中情人。一个扮可爱的女孩Rosemary。二人简直天生一对，其做作直叫旁人呕吐。&nbsp;　　21世纪爱&nbsp;　　菲与阿一是酒吧的熟客。两人的结合和分手都发生在酒吧里。他们故意带着别人在酒吧里玩，刺激对方。";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:60:"HD高清$https://www.625135.com/20190417/KA4ZphHQ/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:8;s:9:"type_name";s:9:"爱情片";s:7:"type_en";s:10:"aiqingpian";s:9:"type_sort";i:3;s:8:"type_mid";i:1;s:8:"type_pid";i:1;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:72:"好看的爱情片,最新爱情片,经典爱情片,国语爱情片电影";s:8:"type_des";s:205:"2018最新爱情片，好看的爱情片大全和排行榜推荐，免费爱情片在线观看和视频在线播放是由本网站整理和收录，欢迎爱情片爱好者来到这里在线观看爱情片";s:10:"type_title";s:72:"好看的爱情片-最新爱情片-经典爱情片-最新爱情片推荐";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:6:"type_1";a:18:{s:7:"type_id";i:1;s:9:"type_name";s:6:"电影";s:7:"type_en";s:8:"dianying";s:9:"type_sort";i:1;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:77:"电影,电影大全,电影天堂,最新电影,好看的电影,电影排行榜";s:8:"type_des";s:171:"为您提供更新电影、好看的电影排行榜及电影迅雷下载，免费在线观看伦理电影、动作片、喜剧片、爱情片、搞笑片等全新电影。";s:10:"type_title";s:6:"电影";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:197:"喜剧,爱情,恐怖,动作,科幻,剧情,战争,警匪,犯罪,动画,奇幻,武侠,冒险,枪战,恐怖,悬疑,惊悚,经典,青春,文艺,微电影,古装,历史,运动,农村,儿童,网络电影";s:4:"area";s:113:"大陆,香港,台湾,美国,法国,英国,日本,韩国,德国,泰国,印度,意大利,西班牙,加拿大,其他";s:4:"lang";s:65:"国语,英语,粤语,闽南语,韩语,日语,法语,德语,其它";s:4:"year";s:44:"2